dataLineage.statement:
La couche SIG est construite à partir de différentes sources

- Trait de côte européen, source Agence Européenne de l'Environnement (EEA) ;
- Frontières et limites de régions françaises, source IGN ;
- Limites maritimes françaises, source SHOM ;
- Limites maritimes OSPAR, source OSPAR ;

La table attributaire comporte 6 champs :
- ZONE : prend les valeurs "terre", "12MN", "ZEE", "ZPE";
- ZONE_1 : prend les valeurs "terre", "océen atlantique", "mer méditérranée" ;
- ZONE_3 : predn les valeurs "MAN", "ATL", "MED" ;
- SS_REGION : prend les valeurs des noms des sous-régions DCSMM ;
- PAYS : prend la valeur du nom du pays en mer et à terre ;
- REGION : prend les valeurs des noms des régions françaises ;
